import React from "react";
import { BrowserRouter as Routers, Route, Routes} from 'react-router-dom';

import Personalized_data_dispenser from "./Personalized_data_dispenser";

const Personalized_data_progresser = (props) => {

    switch(typeof props){

        case ('object'): 
        return <React.Fragment>
            <Routers>

            <Routes>
            <Route path='/' element={<Personalized_data_dispenser/>}/>
            

            <Route path='/test' element={<Personalized_data_dispenser/>}/>
            

            <Route path='/rest' element={<Personalized_data_dispenser/>}/>
            

            </Routes>

            </Routers>

        </React.Fragment>
       

        // return <React.Fragment>

        //     <Personalized_data_dispenser></Personalized_data_dispenser>
        //     <Personalized_data_dispenser></Personalized_data_dispenser>

        // </React.Fragment>

        case ('undefined'): return 'none';
    }

}

export default Personalized_data_progresser;
